7.descriere:
Vioara Flame cu un finisaj bun ofera un sunet clar la un pret mic!

Dimensiuni: 1/8;
Recomandata copiilor cu varsta intre 4-6 ani
fata din lemn de brad;
spate din lemn de paltin;
limba din mahon;
include: cutie, arcus, sacaz, fixuri;
culoare: nature.

